import { Component } from "react";

class typeOfPoke extends Component{

    render(){
        
        const {monsters} = this.props;

        return(
            <div>
                {monsters.types.map((pokeType) =>(

                    <button>{pokeType.type.name}</button>

                ) )}
            </div>
        )
    }

}

export default typeOfPoke;
